- input: TEXT,F3XA,,"The Schedule A for the MI State Party Victory Fund is for the
    2nd Quarter which includes a transfer from the Democratic National Committee on
    4/15/2004 in the amount of $19,910.49.  The payments for rent to the Democratic
    State Central Committee (Non-Fed) are not reimbursements to the non-federal account
    for shared allocable expenses.  The payments are for rent for our nightly bingo
    games which is required under State law.  The transfers to the non-federal account
    were not used to finance any activity in connection with federal elections.  The
    Contract Labor Political Consultant is not an employee of MDSCC.  The refund from
    the Detroit Mariott was allocated in the original payment but no non-federal transfer
    was actually made so there was no reallocation with the refund. The Exempt bumper
    stickers and Literature were distributed by volunteers therefore do not meet the
    criteria of Federal Election Activity."
